api.controller = function($scope, spModal, $rootScope, spUtil, $uibModal, $http) {
    var c = this;
    c.data.isCheckedIn = isCheckedIn;
    c.data.canSave = canSave;
    c.data.updateProblemCause = updateProblemCauses;
    c.data.updateResolutionCodes = updateResolutionCodes;
    function updateProblemCauses() {
        c.data.untaggedEqp.problem_cause = {
            value: '',
            displayValue: ''
        };
        c.data.untaggedEqp.problem_cause_qualifier = 'u_asset_type=' + c.data.untaggedEqp.type.value;
        c.data.alreadySaved = false;
    }
    c.data.untaggedEqp.resolution_code_qualifier = 'u_related_problem_cause=name=FOO^name=BAR';
    function updateResolutionCodes() {
        c.data.untaggedEqp.resolution_code = {
            value: '',
            displayValue: ''
        };
        c.data.untaggedEqp.resolution_code_qualifier = 'u_related_problem_cause=' + c.data.untaggedEqp.problem_cause.value;
        c.data.alreadySaved = false;
    }
    c.saveUntaggedEqp = function() {
        if (c.data.untaggedEqp.resolution_code.value != '') {
            c.data.loading = true;
            c.data.action = 'saveUntaggedEqp';
            c.server.update().then(function() {
                spModal.alert('This untagged equipment has been saved.');
                c.data.loading = false;
            });
        }
    };
    c.cancelSave = function() {
        c.data.confirmed = "asking";
        spModal
            .open({
                title: 'Remove?',
                message: 'Do you want to remove this untagged equipment? Information will be lost.',
                buttons: [{
                        label: 'No, Resume',
                        primary: false
                    },
                    {
                        label: 'Yes, Remove',
                        primary: true
                    }
                ]
            })
            .then(
                function(confirmed) {
                    c.data.confirmed = confirmed;
                    if (c.data.confirmed.primary == true) {
                        c.data.loading = true;
                        c.server.get({
                            action: 'cancelSave'
                        }).then(function(response) {
                            c.data.untaggedEqp.problem_cause = {
                                value: '',
                                displayValue: ''
                            };
                            c.data.untaggedEqp.type = {
                                value: '',
                                displayValue: ''
                            };
                            c.data.untaggedEqp.resolution_code = {
                                value: '',
                                displayValue: ''
                            };
                            c.data.loading = false;
                        });
                    } else {
                    }
                });
    };
    function isCheckedIn() {
        c.data.LaborTimeSheet = angular.element('#workOrder').scope().c.data.LaborTimeSheet;
        var isCheckIn = true;
        if (!c.data.LaborTimeSheet) {
            return false;
        }
        if (c.data.LaborTimeSheet.u_start_time.value == '' && c.data.LaborTimeSheet.u_end_time.value == '') {
isCheckIn = false;
        } else if (c.data.LaborTimeSheet.u_start_time.value != '' && c.data.LaborTimeSheet.u_end_time.value != '') {
isCheckIn = false;
        } else if (c.data.LaborTimeSheet.u_start_time.value != '' && c.data.LaborTimeSheet.u_end_time.value == '') {
isCheckIn = true;
        } else if (c.data.LaborTimeSheet.u_start_time.value == '' && c.data.LaborTimeSheet.u_end_time.value != '') {
isCheckIn = false;
        }
        return isCheckIn;
    }
    function canSave() {
        if (c.data.untaggedEqp.resolution_code.value == '' || c.data.untaggedEqp.resolution_code.value == null) {
            return false;
        } else {
            return true;
        }
    }
};

