    function _validateFields() {
        var isValid = true;
        var emptyField = [];
        if (c.data.record.u_functional_status.value === '') {
            emptyField.push('Functional Status should not be in Work in Progress');
            spModal.alert('Please select a new Work Order Functional Status');
        }
        if ((c.data.comments == '' || c.data.comments == undefined) && (c.data.record.u_functional_status.value === '19' || c.data.record.u_functional_status.value === '20' || c.data.record.u_functional_status.value === '11')) {
            spModal.alert('Please fill the additional comments');
            isValid = false;
        }
        if (c.data.record.u_functional_status.value == '5') {
            var missingResolution = false;
            if (c.data.record.resolution_code.value == '' || c.data.record.resolution_code.value == undefined) missingResolution = true;
            if (c.data.record.problem_cause.value == '' || c.data.record.problem_cause.value == undefined) missingResolution = true;
            if (c.data.record.asset_type.value == '' || c.data.record.asset_type.value == undefined) missingResolution = true;
            if (c.data.record.resolution_detail.value == '' || c.data.record.resolution_detail.value == undefined) missingResolution = true;
            if (missingResolution) {
                spModal.alert('Please ensure you have added the resolution fields detail.');
                isValid = false;
            }
        }
        if (emptyField.length > 0) {
            isValid = false;
        }
        return isValid;
    }
    function validateTimeSheet(t_type) {
        if (t_type === 'labor') {
            if (c.data.TravelTimeSheet) {
                var startTime = c.data.TravelTimeSheet.u_start_time.value;
                var endTime = c.data.TravelTimeSheet.u_end_time.value;
                if (startTime != '' && endTime == '') {
                    _promptUser(c.data.record.number.displayValue, c.data.record.number.value, 'travel');
                    return;
                }
            }
        } else if (t_type === 'travel') {
            if (c.data.isCheckedIn()) {
                _promptUser(c.data.record.number.displayValue, c.data.record.number.value, 'labor');
                return;
            }
        }
