providers.script:
function() {
	return {
		restrict: 'A',
		scope: {
			'selectWidth': '@',
			'ngModel': '='
		},
		link: function(scope, element, attrs) {
			element.select2({
				minimumResultsForSearch: Infinity,
			});
			scope.$watch('ngModel', function(newVal, oldVal) {
				window.setTimeout(function() {
					element.select2("val", newVal);
				});
			});
		}
	};
}

function customSEField() {
    return {
        restrict: "E",
        scope: {
            displayValue: '=?',
            displayLabel: '@',
            displayCol: '=',
			className: '@?'
        },
        template: '<div class="col-xs-{{displayCol}} {{className}}">' +
'<label class="ihm-label ihm-label-top">{{displayLabel}}</label>' +
'<div class="ihm-form-control m-t-xs ihm-disabled"> <span>{{displayValue}}</span> </div>' +
'</div>'
    };
}
